            </Link>
            <h1>What's for ____?</h1>
            <form>
                <div className="form-group">
                    <label>Ingredient</label>
                    <input name="ingredient" type="text"></input>
                    <button name="add-ingredient">Add Ingredient</button>
                </div>
                <button>Submit</button>
            </form>
        </div>
    );
}
